var map = L.map('map').setView([-7.976966412422513, 112.63207633190689], 12);

}).addTo(map);

L.geoJson(kel_malang).addTo(map);

function getColor(d) {
  return d > 210 ? '#8dd3c7' :
        d > 203  ? '#ffffb3' :
        d > 200  ? '#bebada' :
        d > 190  ? '#fb8072' :
        d > 170   ? '#80b1d3' :
        d > 150   ? '#fdb462' :
        d > 101   ? '#b3de69' : 
                    '#fccde5';
}
//['#d9d9d9']

function style(feature) {
  return {
      fillColor: getColor(feature.properties.density),
      weight: 2,
      opacity: 1,
      color: 'white',
      dashArray: '3',
      fillOpacity: 0.7
    };
}

L.geoJson(kel_malang, {style: style}).addTo(map);


//Menambahkan Interaksi
function highlightFeature(e) {
  var layer = e.target;

  layer.setStyle({
      weight: 5,
      color: '#666',
      dashArray: '',
      fillOpacity: 0.7
  });

  layer.bringToFront();
  info.update(layer.feature.properties);
}

function resetHighlight(e) {
  geojson.resetStyle(e.target);
  info.update();
}


//geojson
var geojson;
// ... our listeners


function zoomToFeature(e) {
  map.fitBounds(e.target.getBounds());
}

function onEachFeature(feature, layer) {
  layer.on({
      mouseover: highlightFeature,
      mouseout: resetHighlight,
      click: zoomToFeature
  });
}

geojson = L.geoJson(kel_malang, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);


//Kontrol Info Kustom
var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function (props) {
    this._div.innerHTML = '<center><h2><b>Jumlah Penduduk <br> Kecamatan Kota Malang</b></h2></center>' +  (props ?
        '<br> <b> <h3> ' + props.name + '</b> </h3>  <br />' + props.density + ' Orang <br>' + props.laki + ' Laki - Laki <br> ' + props.perempuan + ' Perempuan '
        : 'Arahkan Kursor ke Suatu Daerah');
};

info.addTo(map);
